import 'isomorphic-fetch';
import useRedirectToLogin from '../hooks/useRedirectToLogin';
import Layout from '../components/Layout';
import CardsContainer from '../components/CardsContainer';

const index = ({ toDoList }) => {
  useRedirectToLogin();
  return (
    <>
      <Layout title="To Do Page">
        {T}
        <CardsContainer title="To Do" toDoList={toDoList} />
      </Layout>

      <style jsx global>
        {`
          * {
            margin: 0;
            padding: 0;
          }
        `}
      </style>
    </>
  );
};

export async function getServerSideProps({ query }) {
  try {
    let url = 'http://localhost:8000/api/v1/todo/';
    if (query.done) url = `${url}?done=${query.done}`;
    const response = await fetch(url, {
      headers: {
        Authorization: 'Token 7664ec2dd5c8c914e44449d18ed46b9abb35891c',
      },
    });
    const toDoResponse = await response.json();
    const toDoList = toDoResponse.results;
    return {
      props: { toDoList },
    };
  } catch (error) {
    return error;
  }
}

export default index;
